import axios from "axios"
import {useState} from "react"
let App=()=>{
  let [sid,setSid]= useState("")
  let [data,setData] = useState(" ")
  let fun =()=>{
    axios.get(`http://localhost:5000/getbyid/${sid}`).then((res)=>{
      setData(res.data)
    }).catch((err)=>{
      console.log(err)
    })
  }
  return(
    <div>
      <div>
      <input type="text" onChange={(e)=>setSid(e.target.value)} placeholder="enter sid"/>
      <button onClick={fun}>GetResult</button>
      </div>
      {data!=null && data !==" " && 
      <div>
        <h1>Roll no:{data._id}</h1>
        <h1>Marks :{data.marks}</h1>
      </div>}
      {data==null && <div>Check student id</div>}
    </div>
  )
}
export default App
